(1, 23, 'Posture du dirigeant et responsabilit√© personnelle', 'üéØ Bloc 1 ‚Äì Posture du dirigeant & responsabilit√© personnelle\r\nCe bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† assumer pleinement son r√¥le de d√©cideur final,\r\n\r\n‚óè son aptitude √† dissocier √©motions, relations personnelles et d√©cisions professionnelles,\r\n\r\n‚óè sa facult√© √† poser un cadre clair et coh√©rent, y compris avec les proches et la famille impliqu√©s dans l‚Äôentreprise,\r\n\r\n‚óè sa capacit√© √† faire respecter les r√®gles sans exception,\r\n\r\n‚óè son niveau d‚Äôexemplarit√© personnelle dans l‚Äôapplication des r√®gles et exigences,\r\n\r\n‚óè sa mani√®re de se positionner lui-m√™me comme acteur responsable de l‚Äôentreprise, notamment √† travers sa r√©mun√©ration.', 0, 1, '2026-01-17 12:21:28', '2026-01-17 12:21:28'),
(2, 24, 'Stabilit√© √©motionnelle et maturit√© d√©cisionnelle du dirigeant', 'üéØ OBJECTIF DU BLOC 2 \r\nCe bloc permet de mesurer :\r\n‚óè la stabilit√© √©motionnelle r√©elle du dirigeant,\r\n\r\n‚óè sa capacit√© √† d√©cider sans √™tre domin√© par ses √©motions,\r\n\r\n‚óè son mode de raisonnement face aux probl√®mes,\r\n\r\n‚óè sa maturit√© d√©cisionnelle, pas son intelligence th√©orique.', 0, 1, '2026-01-17 12:23:12', '2026-01-17 12:23:12'),
(3, 25, 'Ma√Ætrise du cadre juridique, fiscal et social', 'üéØ Ce bloc 3 permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† comprendre le cadre juridique, fiscal et social de son entreprise,\r\n\r\n‚óè son niveau de ma√Ætrise fonctionnelle des obligations essentielles, sans expertise technique,\r\n\r\n‚óè sa facult√© √† poser les bonnes questions aux experts,\r\n\r\n‚óè sa capacit√© √† anticiper les risques li√©s aux retards, oublis ou manquements,\r\n\r\n‚óè son aptitude √† piloter les points critiques, m√™me lorsqu‚Äôil d√©l√®gue l‚Äôex√©cution.\r\nCe bloc √©value si le dirigeant subit la conformit√© ou s‚Äôil la comprend suffisamment pour s√©curiser son entreprise.', 0, 1, '2026-01-17 12:24:09', '2026-01-17 12:24:09'),
(4, 26, 'Intelligence financi√®re et pilotage par les chiffres', 'BLOC 4 ‚Äî INTELLIGENCE FINANCI√àRE & PILOTAGE DE L‚ÄôENTREPRISE\r\n(D√©cider √† partir des chiffres, pas des impressions)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† comprendre les chiffres essentiels de son entreprise,\r\n\r\n‚óè son aptitude √† piloter l‚Äôactivit√© √† partir de donn√©es r√©elles,\r\n\r\n‚óè sa facult√© √† fixer des r√©mun√©rations et charges de mani√®re coh√©rente,\r\n\r\n‚óè sa capacit√© √† suivre les √©carts entre attentes et r√©sultats,\r\n\r\n‚óè son r√©flexe √† ajuster ses d√©cisions selon la performance r√©elle.\r\nüëâ Ce bloc √©value si l‚Äôentreprise est pilot√©e √† l‚Äôintuition ou √† partir de sa r√©alit√© √©conomique.', 0, 1, '2026-01-17 12:26:07', '2026-01-17 12:26:07'),
(5, 27, 'Organisation, planification et gouvernance simplifi√©e', 'BLOC 5 ‚Äî ORGANISATION, PLANIFICATION & GOUVERNANCE SIMPLIFI√âE\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† planifier l‚Äôactivit√© au-del√† du court terme,\r\n\r\n‚óè son aptitude √† hi√©rarchiser ce qui est strat√©gique, tactique et op√©rationnel,\r\n\r\n‚óè sa facult√© √† se positionner correctement dans l‚Äôex√©cution,\r\n\r\n‚óè sa capacit√© √† d√©l√©guer sans perdre le contr√¥le,\r\n\r\n‚óè son aptitude √† installer un minimum de r√®gles internes permettant √† l‚Äôentreprise de fonctionner sans d√©sordre.\r\n\r\nüëâ Ce bloc √©value si l‚Äôentreprise repose sur l‚Äôorganisation ou principalement sur la pr√©sence permanente du dirigeant.', 0, 1, '2026-01-17 12:27:12', '2026-01-17 12:27:12'),
(6, 28, 'Management des personnes et ressources humaines', 'BLOC 6 ‚Äî MANAGEMENT DES PERSONNES & RESSOURCES HUMAINES\r\n(Encadrer avec clart√©, ajuster avec justesse)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† constituer une √©quipe adapt√©e √† ses besoins r√©els,\r\n\r\n‚óè son aptitude √† √©couter et int√©grer les retours sans crispation,\r\n\r\n‚óè sa facult√© √† formuler des attentes claires (missions, r√©sultats, d√©lais),\r\n\r\n‚óè sa capacit√© √† suivre la performance et ajuster,\r\n\r\n‚óè son aptitude √† mettre fin √† une collaboration de mani√®re professionnelle lorsque n√©cessaire.\r\nüëâ Ce bloc √©value si l‚Äô√©quipe est pilot√©e par le cadre, la clart√© et le suivi, ou par l‚Äôaffect et l‚Äôimprovisation.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(7, 29, 'Approvisionnements, fournisseurs et op√©rations', 'BLOC 7 ‚Äî APPROVISIONNEMENTS, FOURNISSEURS & OP√âRATIONS\r\n(S√©curiser l‚Äôactivit√© sans subir les impr√©vus)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† organiser et s√©curiser ses approvisionnements,\r\n\r\n‚óè son aptitude √† choisir et piloter ses fournisseurs,\r\n\r\n‚óè sa facult√© √† anticiper les besoins et les ruptures,\r\n\r\n‚óè sa capacit√© √† ma√Ætriser les co√ªts et la continuit√© des op√©rations,\r\n\r\n‚óè son niveau de d√©pendance √† un fournisseur ou √† l‚Äôimprovisation.\r\nüëâ Ce bloc √©value si l‚Äôactivit√© est subie au quotidien ou pilot√©e de mani√®re pr√©visible et ma√Ætris√©e.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(8, 30, 'Administration, documentation et tra√ßabilit√©', 'BLOC 8 ‚Äî ADMINISTRATION, DOCUMENTATION & TRA√áABILIT√â\r\n(G√©rer proprement pour s√©curiser l‚Äôactivit√©)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† produire les documents administratifs essentiels,\r\n\r\n‚óè son aptitude √† suivre les flux financiers li√©s aux ventes,\r\n\r\n‚óè sa facult√© √† archiver et retrouver l‚Äôinformation,\r\n\r\n‚óè son niveau de professionnalisation et de conformit√© administrative,\r\n\r\n‚óè sa capacit√© √† s√©curiser l‚Äôentreprise face aux contr√¥les, litiges ou oublis.\r\nCe bloc √©value si l‚Äôadministration soutient l‚Äôactivit√© ou devient un point de fragilit√©.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(9, 31, 'Vente, prix et relation client', 'BLOC 9 ‚Äî VENTE, PRIX & RELATION CLIENT\r\n(Vendre avec m√©thode, pas au hasard)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† vendre personnellement ses produits ou services,\r\n\r\n‚óè son aptitude √† aller vers le client et le prospect,\r\n\r\n‚óè sa ma√Ætrise des canaux de distribution,\r\n\r\n‚óè sa capacit√© √† fixer des prix comp√©titifs et rentables,\r\n\r\n‚óè son aptitude √† faire √©voluer son offre √† partir des retours clients.\r\n\r\nCe bloc √©value si le chiffre d‚Äôaffaires est subi, opportuniste ou r√©ellement pilot√©.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(10, 32, 'R√©seautage et utilisation strat√©gique du carnet d‚Äôadresses', 'BLOC 10 ‚Äî R√âSEAUTAGE & UTILISATION STRAT√âGIQUE DU CARNET D‚ÄôADRESSES\r\n(Transformer les relations en opportunit√©s utiles)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† fr√©quenter des espaces r√©ellement utiles √† son activit√©,\r\n\r\n‚óè son aptitude √† entretenir et structurer son r√©seau,\r\n\r\n‚óè sa capacit√© √† transformer les relations en opportunit√©s concr√®tes (information, march√©s, ressources).\r\n\r\nüëâ Ce bloc √©value si le r√©seau est subi, occasionnel ou utilis√© comme un levier strat√©gique.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(11, 33, 'Auto-√©valuation et remise en question', 'BLOC 11 ‚Äî AUTO-√âVALUATION & REMISE EN QUESTION\r\n(Lucidit√© du dirigeant)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† regarder ses actions avec recul,\r\n\r\n‚óè son aptitude √† reconna√Ætre ses erreurs sans se rigidifier,\r\n\r\n‚óè sa facult√© √† ajuster ses d√©cisions lorsque la r√©alit√© √©volue,\r\n\r\n‚óè sa capacit√© √† demander conseil sans y voir une fragilit√©,\r\n\r\n‚óè son aptitude √† tirer des enseignements concrets de ses exp√©riences.\r\nüëâ Ce bloc √©value si le dirigeant apprend r√©ellement de son parcours ou s‚Äôil r√©p√®te les m√™mes sch√©mas.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(12, 34, 'Gestion des risques op√©rationnels', 'BLOC 12 ‚Äî GESTION DES RISQUES OP√âRATIONNELS\r\n(Anticipation minimale vitale)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† identifier les points de d√©pendance critiques,\r\n\r\n‚óè son aptitude √† anticiper les impr√©vus majeurs,\r\n\r\n‚óè sa facult√© √† pr√©voir des alternatives simples,\r\n\r\n‚óè sa capacit√© √† r√©agir rapidement sans d√©sorganisation,\r\n\r\n‚óè son niveau de pr√©paration √† la continuit√© de l‚Äôactivit√©.\r\nüëâ Ce bloc √©value si l‚Äôentreprise peut absorber un choc ou si elle s‚Äôarr√™te au premier impr√©vu.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(13, 35, 'Capacit√© d‚Äôapprentissage et adaptation', 'BLOC 13 ‚Äî CAPACIT√â D‚ÄôAPPRENTISSAGE & ADAPTATION\r\n(Apprendre plus vite que les probl√®mes)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† tirer des enseignements concrets de l‚Äôexp√©rience terrain,\r\n\r\n‚óè son aptitude √† faire √©voluer ses pratiques dans le temps,\r\n\r\n‚óè sa facult√© √† formaliser simplement ce qui fonctionne,\r\n\r\n‚óè sa capacit√© √† √©viter la r√©p√©tition des m√™mes erreurs structurelles,\r\n\r\n‚óè son niveau de progression continue, personnelle et organisationnelle.\r\nüëâ Ce bloc √©value si l‚Äôentreprise apprend r√©ellement ou si elle r√©p√®te les m√™mes sch√©mas sous des formes diff√©rentes.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(14, 36, 'Conscience du r√¥le du dirigeant', 'BLOC 14 ‚Äî CONSCIENCE DU R√îLE DU DIRIGEANT\r\n(Passer de ‚Äúfaire‚Äù √† ‚Äúpiloter‚Äù)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† prendre conscience de l‚Äô√©volution de son r√¥le √† mesure que l‚Äôentreprise grandit,\r\n\r\n‚óè son aptitude √† red√©finir sa place entre ex√©cution, coordination et pilotage,\r\n\r\n‚óè sa facult√© √† d√©l√©guer, maintenir ou abandonner certaines t√¢ches,\r\n\r\n‚óè sa capacit√© √† accepter de ne plus √™tre indispensable √† tout,\r\n\r\n‚óè son niveau de maturit√© face √† la croissance de l‚Äôentreprise.\r\nüëâ Ce bloc √©value si le dirigeant accompagne la croissance de l‚Äôentreprise ou s‚Äôil en devient, malgr√© lui, un facteur de blocage.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(15, 37, '√âquilibre vie priv√©e ‚Äì vie professionnelle & charge mentale', 'BLOC 15 ‚Äî √âQUILIBRE VIE PRIV√âE ‚Äì VIE PROFESSIONNELLE & CHARGE MENTALE\r\n(Durabilit√© personnelle et performance)\r\nüéØ Ce bloc permet de mesurer :\r\n‚óè la capacit√© du dirigeant √† organiser son temps entre les diff√©rentes sph√®res de vie,\r\n\r\n‚óè son aptitude √† pr√©venir la surcharge mentale et l‚Äô√©puisement,\r\n\r\n‚óè sa facult√© √† d√©l√©guer ou n√©gocier la r√©partition des charges personnelles et domestiques (si applicable),\r\n\r\n‚óè sa capacit√© √† pr√©server la continuit√© de l‚Äôentreprise malgr√© les pressions personnelles ou conjugales,\r\n\r\n‚óè son aptitude √† se ressourcer de mani√®re autonome.\r\nCe bloc √©value si la performance du dirigeant est soutenable dans le temps ou repose sur un √©quilibre fragile.', 0, 1, '2026-01-17 12:36:08', '2026-01-17 12:36:08'),
(16, 5, 'Interpr√©tation des scores - Bloc 1', 'Il faut poser les bases : qui fait quoi, comment on travaille, comment on √©change. Tu as besoin d‚Äôun accompagnement imm√©diat. \r\nTu as commenc√© √† t‚Äôorganiser, mais beaucoup de choses ne sont pas encore claires. Il faut structurer ton travail. \r\nTu as une bonne organisation, mais il reste quelques points √† renforcer pour bien grandir. \r\nBravo‚ÄØ! Ton entreprise est bien structur√©e. Tu es pr√™t pour grandir, recruter ou d√©l√©guer efficacement.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(17, 6, 'Interpr√©tation des scores - Bloc 2', 'Ton mod√®le √©conomique est flou ou risqu√©. Il faut clarifier ce que tu proposes, √† qui, et comment tu gagnes. Tu as besoin d‚Äôun appui strat√©gique rapide.\r\nTu as des bases, mais il manque des tests concrets, une vraie connaissance client, ou une vision claire des b√©n√©fices.\r\nTon activit√© est en place, tu vends et tu gagnes un peu. Il faut renforcer les calculs de rentabilit√© et penser √† la duplication.\r\nTon mod√®le est clair, rentable, structur√© et duplicable. Tu es pr√™t pour lever des fonds ou changer d‚Äô√©chelle.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(18, 7, 'Interpr√©tation des scores - Bloc 3', 'Tu avances sans rep√®re solide. Un accompagnement est n√©cessaire pour clarifier ta vision, poser des fondations, et apprendre √† piloter.\r\nTu t‚Äôen sors gr√¢ce √† ton instinct, mais sans vraie m√©thode. Il faut structurer ta posture de dirigeant pour durer.\r\nTu sais piloter ton projet avec s√©rieux. Avec un bon r√©seau et un appui strat√©gique, tu peux aller plus loin.\r\nTu as une posture mature de chef‚Ä¢fe d‚Äôentreprise. Tu pourrais m√™me encadrer d‚Äôautres ou viser un passage √† l‚Äô√©chelle.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(19, 8, 'Interpr√©tation des scores - Bloc 4', 'Tu n‚Äôas pas encore structur√© la gestion des personnes. Il faut poser les bases (fiches, suivi, r√®gles).\r\nTu arrives √† mobiliser des gens, mais sans vrai cadre. Il faut structurer les r√¥les et la communication.\r\nTu as d√©j√† une bonne gestion d‚Äô√©quipe. Renforce le suivi et pense √† la formation continue.\r\nTu ma√Ætrises bien la gestion humaine. Ton √©quipe est un vrai levier de croissance.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(20, 9, 'Interpr√©tation des scores - Bloc 5', 'Tu cours des risques juridiques et fiscaux. Tu dois r√©gulariser ta situation d‚Äôurgence.\r\nTu as commenc√©, mais ce n‚Äôest pas suffisant. Il faut consolider ta formalisation.\r\nTu es d√©j√† bien engag√© dans la r√©gularisation. Il reste quelques √©tapes √† valider.\r\nTu es √† jour, ton activit√© est l√©galement prot√©g√©e. Tu peux participer √† des appels d‚Äôoffres ou chercher des financements.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(21, 10, 'Interpr√©tation des scores - Bloc 6', 'Tu ne ma√Ætrises pas ton argent. Il faut d‚Äôurgence apprendre √† suivre, noter, et planifier.\r\nTu as commenc√© √† g√©rer, mais sans outils solides. Tu risques les surprises financi√®res.\r\nTu g√®res plut√¥t bien, mais tu peux encore mieux piloter avec des indicateurs et pr√©visions.\r\nTu pilotes ton entreprise comme un pro. Tu peux chercher √† lever des fonds ou √† scaler ton activit√©.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(22, 11, 'Interpr√©tation des scores - Bloc 7', 'Tu n‚Äôutilises presque pas les outils num√©riques. Tu passes √† c√¥t√© d‚Äôun gain de temps, de clients et d‚Äôefficacit√©.\r\nTu commences √† utiliser le digital, mais tu peux aller plus loin. Forme-toi ou automatise certaines t√¢ches.\r\nTu utilises d√©j√† de bons outils, mais il reste des marges de progr√®s pour renforcer ta visibilit√© ou ton efficacit√©.\r\nBravo‚ÄØ! Tu es bien √©quip√©‚Ä¢e pour gagner du temps, toucher plus de clients et mieux piloter ton activit√©.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38'),
(23, 12, 'Interpr√©tation des scores - Bloc 8', 'Tu restes sur place. Il est temps de penser √† l‚Äôavenir, aux nouveaux clients, partenaires ou opportunit√©s.\r\nTu as des id√©es ou des contacts, mais tu ne les actives pas encore vraiment. Priorit√© : strat√©gie de croissance.\r\nTu as une vision, des d√©marches et des actions. Continue √† structurer ton plan et consolide tes relations cl√©s.\r\nTu vises loin et tu t‚Äôen donnes les moyens. Tu es en bonne voie pour devenir une entreprise leader ou √† fort impact.', 0, 1, '2026-01-17 14:03:38', '2026-01-17 14:03:38');
